package com.migibert.kheo.core.plugin.logo;

import java.util.List;

import jersey.repackaged.com.google.common.collect.Lists;

import com.migibert.kheo.core.AbstractSshCommand;

public class LogoCommand extends AbstractSshCommand<List<LogoServerProperty>> {
	public LogoCommand() {
		super("");
	}

	@Override
	public List<LogoServerProperty> parse(String result) {
		LogoServerProperty p = new LogoServerProperty();
		p.encodedImage = "";
		return Lists.newArrayList(p);
	}
}
